          }}><inlineCode parentName="td">{`ps`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-ps-%E8%AF%B4%E6%98%8E"
            }}>{`展示服务／容器`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`restart`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-restart-%E8%AF%B4%E6%98%8E"
            }}>{`重启服务／容器`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`rm`}</inlineCode></td>
          <td parentName="tr" {...{
