        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`start`}</inlineCode>{`, `}<inlineCode parentName="td">{`activate`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-startactivate-%E8%AF%B4%E6%98%8E"
            }}>{`启动服务、容器、主机、应用`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
