          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-up-%E8%AF%B4%E6%98%8E"
            }}>{`启动所有服务`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`volumes`}</inlineCode>{`, `}<inlineCode parentName="td">{`volume`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-volumes-%E8%AF%B4%E6%98%8E"
            }}>{`操作卷`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`inspect`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-inspect-%E8%AF%B4%E6%98%8E"
            }}>{`查看服务、容器、主机、环境、应用、卷的详情`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`wait`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "#rancher-wait-%E8%AF%B4%E6%98%8E"
            }}>{`等待服务、容器、主机、应用栈、机器、项目模版`}</a></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`help`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`展示命令列表或者某个命令的说明`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "2-rancher-cli-全局参数"
    }}>{`2. Rancher CLI 全局参数`}</h2>
    <p>{`当使用`}<inlineCode parentName="p">{`rancher`}</inlineCode>{`时，可以使用不同的全局参数。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`名字`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--debug`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`调试日志`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--config`}</inlineCode>{` value, `}<inlineCode parentName="td">{`-c`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`客户端配置文件 (缺省为 \${HOME}/.rancher/cli.json) `}{`[$RANCHER_CLIENT_CONFIG]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--environment`}</inlineCode>{` value, `}<inlineCode parentName="td">{`--env`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`环境名字或 ID `}{`[$RANCHER_ENVIRONMENT]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--url`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定 Rancher API 接口链接 `}{`[$RANCHER_URL]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--access-key`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定 Rancher API 访问密钥 `}{`[$RANCHER_ACCESS_KEY]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--secret-key`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`指定 Rancher API 安全密钥 `}{`[$RANCHER_SECRET_KEY]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--host`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`执行 docker 命令的主机`}{`[$RANCHER_DOCKER_HOST]`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--wait`}</inlineCode>{`, `}<inlineCode parentName="td">{`-w`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`等待资源到达最终状态`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--wait-timeout`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`等待的超时时间(缺省值: 600 秒)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--wait-state`}</inlineCode>{` value`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`等待的状态(正常, 健康等)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--help`}</inlineCode>{`, `}<inlineCode parentName="td">{`-h`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`展示帮助说明`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`--version`}</inlineCode>{`, `}<inlineCode parentName="td">{`-v`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`打印版本信息`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "21-等待资源"
    }}>{`2.1. 等待资源`}</h3>
    <p>{`全局的选项如`}<inlineCode parentName="p">{`--wait`}</inlineCode>{` 或 `}<inlineCode parentName="p">{`-w`}</inlineCode>{` 可以用于需逐渐到达最终状态的命令。当编辑 Rancher 命令的脚本时，使用`}<inlineCode parentName="p">{`-w`}</inlineCode>{`选项可以让脚本等待资源就绪后再执行下一个命令。等待的超时时间默认时十分钟，但如果您想要改变超时时间，可以使用`}<inlineCode parentName="p">{`--wait-timeout`}</inlineCode>{`选项。您还可以使用`}<inlineCode parentName="p">{`--wait-state`}</inlineCode>{`选项来指定资源必须到达某个特定状态后，命令才结束返回。`}</p>
    <h3 {...{
      "id": "22-rancher-catalog-说明"
    }}>{`2.2. Rancher Catalog 说明`}</h3>
    <p><inlineCode parentName="p">{`rancher catalog`}</inlineCode>{` 命令提供了操作应用商店模版的相关操作。`}</p>
    <h4 {...{
      "id": "221-选项"
    }}>{`2.2.1. 选项`}</h4>
    <p>{`::: v-pre
名字 | 描述
----|-----
`}<inlineCode parentName="p">{`--quiet`}</inlineCode>{`, `}<inlineCode parentName="p">{`-q`}</inlineCode>{` | 只展示 IDs
`}<inlineCode parentName="p">{`--format`}</inlineCode>{` value | `}<inlineCode parentName="p">{`json`}</inlineCode>{`格式或自定义格式: '{{.ID}} {{.Template.Id}}'
`}<inlineCode parentName="p">{`--system`}</inlineCode>{`, `}<inlineCode parentName="p">{`-s`}</inlineCode>{` | 展示系统模版
::::`}</p>
    <h4 {...{
      "id": "222-子命令"
    }}>{`2.2.2. 子命令`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`名字`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
