            "align": null
          }}><inlineCode parentName="td">{`ls`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`列出应用商店模版`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`install`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`安装应用商店模版`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
